body:
I am using pytorch.onnx to export a model and specify the output as dynamic_axes:

dynamic_axes={'input1' : {0:'batch_size'}, 'input2' : {0:'batch_size'}, 'input3':{0:'batch_size'}, 'input4':{0:'batch_size'},
    'output1':[0,1],'output2':[0,1],'output3':[0,1,2],'output4':[0,1],'output5':[0,1],'output6':[0,1,2],'output7':[0,1,2,3],'output8':[0,1]})

The model is successfully exported and I can see the exported onnx model's graph output shape using onnx.load(onnx_model_path):

Shape{
    dim{
        dim_params:"output3_dynamic_axes_1"
    }
    dim{
        dim_params:"output3_dynamic_axes_2"
    }
    dim{
        dim_params:"output3_dynamic_axes_3"
    }
}
That is correct for output3. But when I use:
sess = rt.InferenceSession(onnx_model_path)

And looked into sess.get_outputs(),the shape for output3 is changed to fixed numbers: {name:'output3',shape:[2,4,6],type:'tensor(float)'}.
Not all the output are changed to fixed numbers. Output1,output2,output4,output5,output8 have no problem. Output3, output6 and the first three dimensions in output7 are becoming fixed numbers.

System information:
python: 3.7.6
pytorch: 1.6.0
opset_version: 11
onnx_runtime: 1.4.0
OS: macOS mojave

Is it an issue of onnxruntime when loading the onnx model?

**Describe the bug**
Run with two input nodes and one output node, got error message:
///////////////////////////////////////////////////////////////////////////
model.cpp: In function int main(int, char**):
model.cpp:67:158: error: no matching function for call to Ort::Session::Run(Ort::RunOptions, const char**, const OrtValue* const*, int, const char**, int)
   auto output_tensors = session.Run(Ort::RunOptions{nullptr}, input_node_names.data(), (const OrtValue* const*)&input_tensors, 2, output_node_names.data(), 1);                                                                                                                          ^
model.cpp:67:158: note: candidates are:
In file included from onnxruntime_cxx_api.h:389:0,
                 from model.cpp:4:
onnxruntime_cxx_inline.h:240:27: note: std::vector<Ort::Value> Ort::Session::Run(const Ort::RunOptions&, const char* const*, const Ort::Value*, size_t, const char* const*, size_t)
 inline std::vector<Value> Session::Run(const RunOptions& run_options, const char* const* input_names, const Value* input_values, size_t input_count,
                           ^
onnxruntime_cxx_inline.h:240:27: note:   no known conversion for argument 3 from const OrtValue* const* to const Ort::Value*
onnxruntime_cxx_inline.h:249:13: note: void Ort::Session::Run(const Ort::RunOptions&, const char* const*, const Ort::Value*, size_t, const char* const*, Ort::Value*, size_t)
 inline void Session::Run(const RunOptions& run_options, const char* const* input_names, const Value* input_values, size_t input_count,
             ^
onnxruntime_cxx_inline.h:249:13: note:   candidate expects 7 arguments, 6 provided

//////////////////////////////////////////////////////////////////////////


**Screenshots**
At onnxruntime_cxx_inline.h, I find the api of what i used(first verison)
![image](https://user-images.githubusercontent.com/32813150/90380551-c6a73680-e0ae-11ea-9099-a792e858fc23.png)

**inputs and outputs**
Using Onnxruntime C++ API
Number of inputs = 2
Input 0 : name=text_len:0
Input 0 : type=6
Input 0 : num_dims=1
Input 0 : dim 0=1
Input 1 : name=text:0
Input 1 : type=6
Input 1 : num_dims=2
Input 1 : dim 0=1
Input 1 : dim 1=-1


**System information**
- OS Platform and Distribution : CentOS Linux release 7.5.1804
- ONNX Runtime installed from (source or binary): source
- ONNX Runtime version:  master
- Python version: 3.6

**To Reproduce**
#include <assert.h>
#include <vector>
//#include <onnxruntime_cxx_api.h>
#include "onnxruntime_cxx_api.h"

int main(int argc, char* argv[]) {
  Ort::Env env(ORT_LOGGING_LEVEL_WARNING, "test");

  Ort::SessionOptions session_options;
  session_options.SetIntraOpNumThreads(1); session_options.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_EXTENDED); const char* model_path = "model.onnx";

  printf("Using Onnxruntime C++ API\n");
  Ort::Session session(env, model_path, session_options);

  // print model input layer (node names, types, shape etc.)
  Ort::AllocatorWithDefaultOptions allocator;

  // print number of model input nodes
  size_t num_input_nodes = session.GetInputCount();
  std::vector<const char*> input_node_names(num_input_nodes);
  std::vector<std::vector<int64_t> > input_node_dims;

  printf("Number of inputs = %zu\n", num_input_nodes);

  // iterate over all input nodes
  for (int i = 0; i < num_input_nodes; i++) {
    // print input node names
    char* input_name = session.GetInputName(i, allocator);
    printf("Input %d : name=%s\n", i, input_name);
    input_node_names[i] = input_name;

    // print input node types
    Ort::TypeInfo type_info = session.GetInputTypeInfo(i);
    auto tensor_info = type_info.GetTensorTypeAndShapeInfo();

    ONNXTensorElementDataType type = tensor_info.GetElementType();
    printf("Input %d : type=%d\n", i, type);

    // print input shapes/dims
    input_node_dims.push_back(tensor_info.GetShape());
    printf("Input %d : num_dims=%zu\n", i, input_node_dims.size());
    for (int j = 0; j < input_node_dims[i].size(); j++)
     printf("Input %d : dim %d=%jd\n", i, j, input_node_dims[i][j]);
  }
  
  size_t input_tensor_size_0 = 1;  
  size_t input_tensor_size_1 = 16; 
  std::vector<int64_t> input_tensor_values_0 = {16};
  std::vector<int64_t> input_tensor_values_1 = {3, 89, 75, 11, 4, 74, 62, 12, 7, 94, 82, 12, 4, 66, 3, 1}; 
  
  std::vector<const char*> output_node_names = {"output_minmax:0"};

  // create input tensor object from data values
  auto memory_info = Ort::MemoryInfo::CreateCpu(OrtArenaAllocator, OrtMemTypeDefault);
  Ort::Value input_tensor_0 = Ort::Value::CreateTensor<int64_t>(memory_info, input_tensor_values_0.data(), input_tensor_size_0, input_node_dims[0].data(), 1); 
  Ort::Value input_tensor_1 = Ort::Value::CreateTensor<int64_t>(memory_info, input_tensor_values_1.data(), input_tensor_size_1, input_node_dims[1].data(), 2);
  OrtValue* input_tensors[input_node_names.size()];
  input_tensors[0] = (OrtValue*)&input_tensor_0;
  input_tensors[1] = (OrtValue*)&input_tensor_1;

  //score model & input tensor, get back output tensor
  auto output_tensors = session.Run(Ort::RunOptions{nullptr}, input_node_names.data(), (const OrtValue* const*)&input_tensors, 2, output_node_names.data(), 1);
  assert(output_tensors.size() == 1 && output_tensors.front().IsTensor());


**Expected behavior**
No error.
